import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { JhiLanguageService } from 'ng-jhipster';

import { KnowledgeGraphSharedModule } from 'app/shared';
import { FirstItemAComponent } from './kg-search/first-item-a.component';
import { FirstItemBComponent } from './first-item-b/first-item-b.component';


@NgModule({
    imports: [KnowledgeGraphSharedModule, RouterModule],
    declarations: [FirstItemAComponent, FirstItemBComponent],
    entryComponents: [],
    providers: [{ provide: JhiLanguageService, useClass: JhiLanguageService }],
    schemas: [CUSTOM_ELEMENTS_SCHEMA]
})
export class KnowledgeGraphFirstModule {
}
